def result = new java.lang.StringBuilder()
def binding = new Binding(command:command, result:result, log:log, context:context, testRunner:testRunner)
new GroovyShell(binding).evaluate(new File(context.expand('${projectDir}') + '/scripts/ssh_exec.groovy'));
String[] n = result.toString().trim().split("#");
int status = Integer.parseInt(context.getProperty("exitStatus"))
int mode = Integer.parseInt(n[0]);
int user = Integer.parseInt(n[1]);
int group = Integer.parseInt(n[2]);
int raw = Integer.parseInt(n[3], 16);
int dir = 0x4000
boolean isDir = raw & dir;
int needUser = Integer.parseInt(context.expand('${#TestCase#userID}'))

if (mode != 700 || needUser != user || !isDir) 
	testRunner.fail("File constraints do not match. mode:$mode==700, user:$user==$needUser, dir:$isDir==true")

