def inFolder = context.expand('${#TestCase#baseDIR}') + '/' + context.expand('${#TestCase#accountID}') + '/data/concurrent'
// create temp folder
def command = "mktemp -d"
def result = new java.lang.StringBuilder()
def binding = new Binding(command:command, result:result, log:log, context:context, testRunner:testRunner)
new GroovyShell(binding).evaluate(new File(context.expand('${projectDir}') + '/scripts/ssh_exec.groovy'));
int status = Integer.parseInt(context.getProperty("exitStatus"))
def folder = result.toString().trim()
if (status != 0) 
	testRunner.fail("Failed to create temp directory.")
command = "evilexec cp " + inFolder + "/* " + folder 
result = new java.lang.StringBuilder()
binding = new Binding(command:command, result:result, log:log, context:context, testRunner:testRunner)
new GroovyShell(binding).evaluate(new File(context.expand('${projectDir}') + '/scripts/ssh_exec.groovy'));
status = Integer.parseInt(context.getProperty("exitStatus"))
if (status != 0) 
	testRunner.fail("Failed to copy files.")
// scp files
def source = context.expand('${projectDir}') + '/concurrent'
binding = new Binding(source:source, target:folder, recv:1, log:log, context:context, testRunner:testRunner)
new GroovyShell(binding).evaluate(new File(context.expand('${projectDir}') + '/scripts/ssh_scp.groovy'));
status = Integer.parseInt(context.getProperty("exitStatus"))
if (status != 0) 
	testRunner.fail("File transfer failed.")
// delete temp folder
command = "rm -r " + folder
binding = new Binding(command:command, result:result, log:log, context:context, testRunner:testRunner)
new GroovyShell(binding).evaluate(new File(context.expand('${projectDir}') + '/scripts/ssh_exec.groovy'));
